import React, {Component} from "react";
import {Container, Nav, Navbar} from "react-bootstrap";
import {SocialMedia} from "../data";

export class NavbarTop extends Component {
  render() {
    return (
      <Navbar bg='dark' className='text-white'>
        <Container>
          <Nav>
            <Navbar.Brand className='text-white' style={{fontSize: "16px"}}>
              Welcome to Meeco
            </Navbar.Brand>

            {SocialMedia.map(({icon, link}, index) => {
              return (
                <li key={index}>
                  <Nav.Link className='text-white' href={link}>
                    <i className={icon}></i>
                  </Nav.Link>
                </li>
              );
            })}
          </Nav>
        </Container>
      </Navbar>
    );
  }
}

export default NavbarTop;
